import React from "react";
import Nav from '../components/navbar';

function Contact(props) {
  return (
    <div id="wrapper">
      <Nav />
      <h2 >Contact US</h2>
      <style jsx>{`
        body {
          margin: 0;
        }
        #wrapper {
          float: left;
          margin: 0;
          width: 100%;
        }
        `}</style>
    </div>

  );
}

export default Contact;
